import React from 'react'
import styled from '@emotion/styled'

const Container = styled.div`
    flex: 1;
    padding: 20px;
    display: flex;
    flex-flow: column wrap;
`

const Updated = ({ global }) => {
    return (
        <Container>
            Updated: 
            {global.updatedAt}
        </Container>
    );
}

export default Updated
